  //{{{  uciLog
  
  function uciLog () {
  
    if (cwtch.quiet)
      return;
  
    var s = '';
  
    for (var i = 0; i < arguments.length; i++)
      s += arguments[i] + ' ';
  
    console.log(s);
  }
  
